                                                                                          (47.203259, 0.865853, 201, '19 Route des Mares, 37310 Tauxigny, France', 'Ecole de Kung Fu Tigre et Héron n\'a pas encore rédigé de description...', 'Ecole de Kung Fu Tigre et Héron', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/87-ecole-de-kung-fu-tigre-et-heron.html'),
                                                                                          (46.851719, 1.067801, 202, '1 Rue des Jardins d\'Azay, 36290 Azay-le-Ferron, France', 'Enseignante des activités physiques adaptées et Diététicienne-Nutritionniste, je réalise une prise en charge adaptée et personnalisée en lien avec les capacités et objectifs de la personne.\r\nJe fais des séances individuelles et collectives par groupe de 6', 'Audrey Martin - Activités Physiques Adaptées', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/180-audrey-martin-activites-physiques-adaptees.html'),
                                                                                          (47.883904, 1.90675, 203, 'Rue Greffier, 45100 Orléans, France', 'L\'Ecole Seon rang propose une séance adaptée d\'activité physique qui aura pour but en fonction de la pathologie du/de la pratiquant(e) d\'améliorer ses capacités physiques sur les plans musculaires, cardiovasculaires, respiratoires, articulaires, cognitifs', 'ECOLE SEON RANG', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/206-ecole-seon-rang.html'),
                                                                                          (47.340393, 0.658014, 204, '16 Rue Jean Monnet, 37300 Joué-lès-Tours, France', 'Sport santé, maladies neurodégénératives et Sport sénior.\r\n', 'badminton jocondien', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/219-badminton-jocondien.html'),
                                                                                          (47.416115, 1.016627, 205, '1 rue de la liberté, 37400 Amboise, France', 'La gym santé est une activité physique adaptée aux personnes atteintes d\'affection de longue durée (diabète, obésité, cancer, maladies cardio-vasculaires...) comme au public sénior. Elle propose des exercices de gymnastique douce qui permettent d\'augmente', 'Avenir d\'Amboise Gymnastique', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/215-avenir-d-amboise-gymnastique.html'),
                                                                                          (47.342705, 0.656758, 206, '3 Rue Jean Bouin, 37300 Joué-lès-Tours, France', 'Le programme Triathlon santé a été lancé en septembre 2019 pour inciter les personnes présentant une pathologie chronique à franchir le pas et à être le mieux accompagné possible dans la pratique de chaque discpline constituant le triathlon (nage, cyclism', 'Triathlon club Joué-lès-Tours', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/208-triathlon-club-joue-les-tours.html'),
                                                                                          (48.014263, 2.749964, 207, 'Allée de l\'Étoile, 45120 Châlette-sur-Loing, France', 'Nordicfit sport et santé anime pour tous publics de tous ages des activités physiques adaptées en santé bien-etre ou pour personnes à pathologies chroniques tels que Gym douce, marche nordique, marche bien etre ou sportive, atelier maman-bébé, accompagnem', 'Nordicfit sport et santé', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/218-nordicfit-sport-et-sante.html'),
                                                                                          (47.902966, 1.909251, 208, 'Orléans, France', 'Séances de rééducation thérapeutique adaptées à la pathologie du patient : personnes à mobilité réduite ou à faible autonomie de motricité suite à accidents cardiovasculaires, traumatismes musculaires, opérations, schlérose en plaque, cancer, douleurs chr', 'Hekaxapa', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/150-hekaxapa.html'),
                                                                                          (47.616528, 1.369265, 209, '3 Rue des Grèves, 41260 La Chaussée-Saint-Victor, France', 'Le comité départemental propose différentes activités de bien-être pour les patients et les aidants actuellement sur Blois, Romorantin et Vendôme:\r\nGymn adaptée, marche nordique, danse en ligne, travail de la voix, gym mémoire, aquagym, sophrolologie.\r\n', 'Comté 41 FRANCE PARKINSON', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/151-comte-41-france-parkinson.html'),
                                                                                          (47.902966, 1.909251, 210, 'Orléans, France', 'Actuellement autoentrepreneur dans une salle de sport, je propose tout type de coaching afin de répondre le plus précisément possible aux attentes du client.\r\nMes priorités lors de mes séances sont l\'écoute afin de répondre au mieux aux exigences du clien', 'Romain Hervey', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/324-romain-hervey.html'),
                                                                                          (47.353897, 1.746787, 211, '66 Rue des Jouannettes, 41200 Romorantin-Lanthenay, France', 'Gymnastique Médicale', 'Cabinet de kinésithérapie Philippe MANCEAU', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/147-cabinet-de-kinesitherapie-philippe-manceau.html'),
                                                                                          (48.433208, 1.466992, 212, '42 Rue du Maréchal Leclerc, 28110 Lucé, France', 'Activités physiques pour personnes souffrant de\r\nmaladie cardio-respiratoires et/ou métaboliques.\r\nA', 'AACGV', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/109-aacgv.html'),
                                                                                          (47.908749, 1.937496, 213, '73 Boulevard Marie Stuart, 45000 Orléans, France', 'La santé par le sport en pratiquant l\'halterophilie pour la lutte contre l\'ostéoporose et le surpoids.\r\nUtilisation de l\'espace cardio et cours collectifs pour le sport bien être', 'CERCLE MICHELET', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/138-cercle-michelet.html'),
                                                                                          (47.902966, 1.909251, 214, 'Romorantin France', 'GV Romorantinaise n\'a pas encore rédigé de description...', 'GV Romorantinaise', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/45-gv-romorantinaise.html'),
                                                                                          (47.600422, 1.317792, 215, '96 Avenue de Vendôme, 41000 Blois, France', 'Salle Elancia n\'a pas encore rédigé de description...', 'Salle Elancia', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/143-salle-elancia.html'),
                                                                                          (47.601875, 1.347956, 216, '146 Bis Avenue du Maréchal Maunoury, 41260 La Chaussée-Saint-Victor, France', 'Créé depuis 1995 par l\'association de kinésithérapeutes DE, de maîtres nageurs et de professeurs de gymnastique/musculation, AQUAVITHAL propose de nombreux cours d\'intensités et de niveaux différents permettant à chacun, malade comme bien portant, de trou', 'Centre aquavithal', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/145-centre-aquavithal.html'),
                                                                                          (46.509781, 1.308295, 217, '36370 Prissac, France / Leblanc 36300', 'Autoentrepreneure\r\nSéance en petit groupe (max 10 pers)\r\nSéance individuelle\r\nIntervention domicile selon distance\r\n', 'CAP A la Santé', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/169-coach-activites-physiques-adaptees.html'),
                                                                                          (46.638535, 1.057203, 218, 'Rue Pierre de Coubertin, 36300 Le Blanc, France', 'L\'activité Nagez Forme Santéest une activité de natation proposée à des personnes cherchant à optimiser leur capital santé. Elle est encadrée par des éducateurs ayant reçu une formation spécifique «Educateur Nagez Forme Santé » afin que chaque pratiquant ', 'CLUB DES DAUPHINS DU BLANC', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/108-club-des-dauphins-du-blanc.html'),
                                                                                          (46.951878, 1.864182, 219, '36100 Saint-Valentin, France', 'CARDIO, RENFORCEMENT MUSCULAIRE, LIA,\r\nJEUX COLLECTIFS\r\n', 'TONIC GYM DE ST VALENTIN', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/148-tonic-gym-de-st-valentin.html'),
                                                                                          (47.182545, 0.968323, 220, 'Rue Marcel Viraud, 37310 Chambourg-sur-Indre, France', '- Renforcement Musculaire\r\n- Cardio-Training\r\n- Gymnastique Posturale\r\n- Pilates\r\n- Gymnastique Equilibre et prévention des chûtes\r\n- Stretching\r\n- Marche Nordique', 'Fit and Zen Chambourg', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/209-fit-and-zen-chambourg.html'),
                                                                                          (47.347969, 0.460695, 221, '37130 Cinq-Mars-la-Pile, France', 'Activités Physiques adaptées aux personnes atteintes de maladie chronique, avec Aline, Alicia Nathalie et Doriane par petits groupes de 6 à 10 personnes pour permettre l\'individualisation dans le collectif. Séances variées - Multi-activités sportives/ Gym', 'Association Agir Sport Santé', 'https://sport-sante-centrevaldeloire.fr/carte/entrée/vue/173-association-agir-sport-sante.html');
